import styled from "@emotion/styled";
// import styled from "@emotion/styled/macro";

export default function MainPage() {
  // styles
  const Container = styled.div`
    background: #fff;
    font-size: 150px;
    color: #fff;
  `;
  const Button = styled.button(Container)`
    color: red;
  `;

  return (
    <Container>
      You now can start working
      <Button>Hey</Button>
    </Container>
  );
}
